const amqplib = require('amqplib');

const content = Buffer.from('', 'hex');

(async () => {
  await publish();
  await get();
})();

async function publish() {
  const connection = await amqplib.connect('amqp://localhost:5672')
  const channel = await connection.createChannel();
  await channel.assertQueue('q764');
  await channel.purgeQueue('q764');
  channel.sendToQueue('q764', content);
  await channel.close();
  await connection.close();
}

async function get() {
  const connection = await amqplib.connect({
    frameMax: 100 * 1024 * 1024
  });
  const channel = await connection.createChannel();

  const { consumerTag } = await channel.consume('q764', async (message) => {
    channel.ack(message);
    await channel.cancel(consumerTag);
    await channel.close();
    await connection.close();
  });
}
